import React from 'react';
import image from './kenah.jpeg';
import './Header.css';

function Header() {
  return (
      <header className="header">
        <img src={image} className="image" alt="image" />
        <h2>Ken Muia</h2>
        <a href='mailto:muiaken88@gmail.com' target="_blank">Email</a>
        <a href='https://www.linkedin.com/in/kennedymuia/' target={_}>LinkedIn</a>
      </header>
  );
}

export default Header;
